TEST_F(DigestComparisonIdenticalTests_2_9, BehaviorComparisonTest)
{
	string gbh[64+1];
	for (unsigned i = 0; i <= 64; i++)
	{
		gbh[i] = string("");
		for (unsigned j = 0; j < i; j++)
			gbh[i].push_back(base64::values[j]);
	}
	for (unsigned bi = 0; bi < 31; bi++)
	{
		string chunk1 = to_string(static_cast<unsigned long>(digest_blocksize::at(bi))) + ":";
		for (blockhash_len_t l2 = 0; l2 <= 64; l2++)
		{
			for (blockhash_len_t l1 = 0; l1 <= 64; l1++)
			{
				string dgst = chunk1 + gbh[l1] + ":" + gbh[l2];
				digest_long_t d(dgst);
				ASSERT_EQ(compare_scores[bi][l2][l1], d.compare<comparison_version::v2_9>(d))
					<< "digest comparison (identical) test with ssdeep 2.9 failed with parameters "
					<< bi << ", " << l1 << ", " << l2 << ".";
			}
			// if the block size is maximum,
			// second blockhash of actual digest cannot exceed 1.
			if (bi == 30 && l2 == 1)
				break;
		}
	}
}

#endif
